import React from 'react';
import Accordion from 'react-bootstrap/Accordion';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class Alarm extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            card_head: props.card_head,
            card_body: props.card_body
        };
    }

    render() {
        return (
            <Card>
                <Card.Header>
                    <Accordion.Toggle as={Button} variant="" eventKey="0">
                        <Row class="mt-3 mr-0 mb-0 ml-3">
                            <h5 class="font-weight-lighter">Alarm #0016</h5>
                        </Row>
                        <Row class="mt-0 mr-0 mb-0 ml-3">
                            <h3 class="font-weight-bolder">SQL-Injection</h3>
                        </Row>
                        <Row class="mt-0 mr-0 mb-3 ml-3">
                            <Col class="text-left p-0" style={"padding: 0px !important"}>
                                <div class="tag bg-danger">
                                    &#8205; &#8205; critical &#8205; &#8205;
                                </div>
                            </Col>
                            <Col class="text-right font-weight-bolder">
                                3 minutes ago
                            </Col>
                        </Row>
                    </Accordion.Toggle>
                </Card.Header>
                <Accordion.Collapse eventKey="0">
                    <Card.Body>
                        {this.state.card_body}
                    </Card.Body>
                </Accordion.Collapse>
            </Card>);
    }
}

export default Alarm;
